/**
 * Create smart processors to handle different formats.
 *
 * @param {import('../compile').CompileOptions} [compileOptions]
 * @return {{extnames: string[], process: process, processSync: processSync}}
 */
export function createFormatAwareProcessors(compileOptions?: import('../compile').CompileOptions): {
    extnames: string[];
    process: (vfileCompatible: import('vfile').VFileCompatible) => Promise<import('vfile').VFile>;
    processSync: (vfileCompatible: import('vfile').VFileCompatible) => import('vfile').VFile;
};
